import React from 'react';
import './App.css';
import task from './images/download.png';

function Header() {
  return (
    <div style={{marginTop:'10px'}}>
      <div style={{display:'inline-block'}}>
        <img src={task} style={{height:'50px',width:'50px'}}></img>
      </div> 
      <div style={{display:'inline-block'}}> 
        <p> Task Manager </p>
        </div>
      <hr/>
    </div> 
  );
}

export default Header;
